import { Link } from "react-router-dom";

const DogsCards = (props) => {
    const {id, name, temperament,weight, img} = props
    return(
        <tr key={id}>
            
            <Link to={`/dogs/${id}`}>
                <td>{name}</td>
                <td>{temperament}</td>
                <td>{weight}</td>
                <td>
                    {/* <img>
                        src = {img}
                        alt = {name}
                        style = {{height: 75}}
                    </img> */}
                </td>
            </Link>
        </tr>
    )
}

export default DogsCards
